import React from 'react';
import ReactDOM from 'react-dom';
import FormSignIn from './FormSignIn'
import './Form.css'
import FormGo2SignUp from './FormGo2SignUp'

class Form extends React.Component {
  render() {
    return (
      <div className='sign row'>
        <FormSignIn />
        <FormGo2SignUp />
      </div>
    );
  }
}

export default Form;
